import React from 'react';
import './style.css'
import { useState } from 'react';

function Square({vlaue, onSquareclick}){
    return(
        <button onClick={onSquareclick} className='square'>{vlaue}</button>
    )
}


function Board() {
    const [squares, setSquares] = useState(Array(9).fill(null))
    return (
        <div>
            <div className='board-row'>
                <Square vlaue={squares[0]} onSquareClick={handleClick}/>
                <Square vlaue={squares[1]} onSquareClick={handleClick}/>
                <Square vlaue={squares[2]} onSquareClick={handleClick}/>
            </div>
            <div className='board-row'>
                <Square vlaue={squares[3]} onSquareClick={handleClick}/>
                <Square vlaue={squares[4]} onSquareClick={handleClick}/>
                <Square vlaue={squares[5]} onSquareClick={handleClick}/>
            </div>
            <div className='board-row'>
                <Square vlaue={squares[6]} onSquareClick={handleClick}/>
                <Square vlaue={squares[7]} onSquareClick={handleClick}/>
                <Square vlaue={squares[8]} onSquareClick={handleClick}/>
            </div>
        </div>
    )
  }

  export default function App(){
    return(
        <Board/>
    )
  }
